import Home from './views/Home';
import './index.css';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Flights from './views/Flights';

function App() {
	return (
		<Router>
			<Routes>
				<Route path="/" exact={true} elem={Home} />
				<Route path="/flights" exact={true} component={Flights} />
			</Routes>
		</Router>
	);
}

export default App;
